index, exit, duration, actual = await self._result()
if exit:
    assert False, f'#{index}: exit after {duration}s; expected: {value} after {delay}s'
elif isinstance(value, set):
    assert actual in value and duration == delay, f'#{index}: {actual} after {duration}s; expected: one of {value} after {delay}s'
else:
    assert actual == value and duration == delay, f'#{index}: {actual} after {duration}s; expected: {value} after {delay}s'
